var vueCommon=new Vue({el:"#vueCommon",data:{},methods:{hidePhoneNumber:function(d){var c=d.split("-");if(c.length===2){return c[0]+"-****"}else{if(c.length===3){return c[0]+"-"+c[1]+"-****"}}return d},checkPhoneNumberType:function(e){var h=e.replace(/[^0-9]/g,"");var f=h.length;var g="";if(f<7){return e}else{if(f===7){g+=h.substr(0,3);g+="-";g+=h.substr(3,4);return g}else{if(f===8){console.log("digit 8 "+h);g+=h.substr(0,4);g+="-";g+=h.substr(4,8);return g}else{if(f===9){g+=h.substr(0,2);g+="-";g+=h.substr(2,3);g+="-";g+=h.substr(5,9);return g}else{if(f===10){if(h.substr(0,2)==="02"){g+=h.substr(0,2);g+="-";g+=h.substr(2,4);g+="-";g+=h.substr(6,4);return g}else{console.log("digit 10 and !02 "+h);g+=h.substr(0,3);g+="-";g+=h.substr(3,3);g+="-";g+=h.substr(6,4);return g}}else{if(f===11){g+=h.substr(0,3);g+="-";g+=h.substr(3,4);g+="-";g+=h.substr(7,4);return g}}}}}}},separateMemo:function(s,v,t){if(s===null||s===""){return"<div class='center'>-</div>"}var r=s.split("{}");var u=v.split("{}");var p=t.split("{}");var o="";for(var i=0,q=r.length;i<q;i++){var s=r[i];var n=u[i];var m=p[i];o+="<div>"+n+" <i class='fa fa-arrow-circle-o-right'></i> "+s;o+="<small>("+m+")</small>";o+="</div>"}return o},extractDateFromDateTime:function(b){if(b){return new moment(b).format("YYYY-MM-DD")}return"날짜없음"}}});